const initialValue = { email: "", psw: "" }
const initialValues = { data: [] }

const LoginData = (state = initialValues, action) => {
    switch (action.type) {
        case "FetchLoginData":
            const { email, psw } = action.payload;
            // return { ...state, email: action.payload.email, psw: action.payload.psw }
            return { ...state, data: [...state.data, { email: email, psw: psw }] }
        default: return state;
    }
}
export default LoginData;
